  false,\n\t\"url\": null,\n\t\"notes\": \"Evidence of lead poisoning at White River
  National Wildlife Refuge was demonstrated by examination of tissues from hunter-killed
  and trapped waterfowl. Elevated liver lead concentration were present in 4% of hunter-killed
  mallards and 9% of trapped mallards; toxic concentrations were present in 5% of
  trapped mallards. One precent of hunter-killed and 5% of trapped mallards had lead
  shot in the gizzard.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
